import React from 'react'
import { Button } from 'antd';
const AddFriendButton = () => {
    return(
        <>
          <Button onClick={onClickButton}>
            {/* {isFollowing?'unfollow':'follow'} */}
            친구 추가
          </Button>
        </>
    )
}

export default AddFriendButton;
